You can interact with the daemon through simple HTTP PUT requests. For example, with cURL , you can store blobs using a publisher or daemon as follows: curl -X PUT "$PUBLISHER/v1/blobs" -d "some string" # store the string `some string` for 1 storage epoch
curl -X PUT "$PUBLISHER/v1/blobs?epochs=5" --upload-file "some/file" # store file `some/file` for 5 storage epochs
curl -X PUT "$PUBLISHER/v1/blobs?send_object_to=$ADDRESS" --upload-file "some/file" # store file `some/file` and send the blob object to $ADDRESS
curl -X PUT "$PUBLISHER/v1/blobs?deletable=true" --upload-file "some/file" # store file `some/file` as a deletable blob, instead of a permanent one The store HTTP API end points return information about the blob stored in JSON format. When a blob is stored for the first time, a newlyCreated field contains information about the new blob: $ curl -X PUT "$PUBLISHER/v1/blobs" -d "some other string"
{ "newlyCreated": { "blobObject": { "id": "0xd765d11848cbac5b1f6eec2fbeb343d4558cbe8a484a00587f9ef5385d64d235", "registeredEpoch": 0, "blobId": "Cmh2LQEGJwBYfmIC8duzK8FUE2UipCCrshAYjiUheZM", "size": 17, "encodingType": "RedStuff", "certifiedEpoch": 0, "storage": { "id": "0x28cc75b33e31b3e672646eacf1a7c7a2e5d638644651beddf7ed4c7e21e9cb8e", "startEpoch": 0, "endEpoch": 1, "storageSize": 4747680 }, "deletable": false }, "resourceOperation": { "registerFromScratch": { "encodedLength": 4747680, "epochsAhead": 1 } }, "cost": 231850 }
} The information returned is the content of the Sui blob object . When the aggregator finds a certified blob with the same blob ID and a sufficient validity period, it returns a alreadyCertified JSON structure: $ curl -X PUT "$PUBLISHER/v1/blobs" -d "some other string"
{ "alreadyCertified": { "blobId": "Cmh2LQEGJwBYfmIC8duzK8FUE2UipCCrshAYjiUheZM", "event": { "txDigest": "CLE41JTPR2CgZRC1gyKK6P3xpQRHCetQMsmtEgqGjwst", "eventSeq": "0" }, "endEpoch": 1 }
} The field event returns the Sui event ID that can be used to find the transaction that created the Sui Blob object on the Sui explorer or using a Sui SDK.

