Walrus blobs are represented as Sui objects of type Blob. A blob is first registered, indicating that the storage nodes should expect slivers from a Blob ID to be stored. Then a blob is certified, indicating that a sufficient number of slivers have been stored to guarantee the blob's availability. When a blob is certified, its certified_epoch field contains the epoch in which it was certified. A Blob object is always associated with a Storage object, reserving enough space for a long enough period for the blob's storage. A certified blob is available for the period the underlying storage resource guarantees storage. Concretely, Blob and Storage objects have the following fields, which can be read through the Sui SDKs: /// The blob structure represents a blob that has been registered to with some storage,
/// and then may eventually be certified as being available in the system.
public struct Blob has key, store { id: UID, registered_epoch: u32, blob_id: u256, size: u64, encoding_type: u8, // Stores the epoch first certified. certified_epoch: option::Option<u32>, storage: Storage, // Marks if this blob can be deleted. deletable: bool,
} /// Reservation for storage for a given period, which is inclusive start, exclusive end.
public struct Storage has key, store { id: UID, start_epoch: u32, end_epoch: u32, storage_size: u64,
} All fields of Blob and Storage objects can be read using the expected functions: // Blob functions
public fun blob_id(b: &Blob): u256;
public fun size(b: &Blob): u64;
public fun erasure_code_type(b: &Blob): u8;
public fun registered_epoch(self: &Blob): u32;
public fun certified_epoch(b: &Blob): &Option<u32>;
public fun storage(b: &Blob): &Storage;
... // Storage functions
public fun start_epoch(self: &Storage): u32;
public fun end_epoch(self: &Storage): u32;
public fun storage_size(self: &Storage): u64;
...

