When a blob is first registered, a BlobRegistered event is emitted that informs storage nodes that they should expect slivers associated with its Blob ID. Eventually when the blob is certified, a BlobCertified is emitted containing information about the blob ID and the epoch after which the blob will be deleted. Before that epoch the blob is guaranteed to be available. /// Signals that a blob with metadata has been registered.
public struct BlobRegistered has copy, drop { epoch: u32, blob_id: u256, size: u64, encoding_type: u8, end_epoch: u32, deletable: bool, // The object id of the related `Blob` object object_id: ID,
} /// Signals that a blob is certified.
public struct BlobCertified has copy, drop { epoch: u32, blob_id: u256, end_epoch: u32, deletable: bool, // The object id of the related `Blob` object object_id: ID, // Marks if this is an extension for explorers, etc. is_extension: bool,
} The BlobCertified event with deletable set to false and an end_epoch in the future indicates that the blob will be available until this epoch. A light client proof that this event was emitted for a blob ID constitutes a proof of availability for the data with this blob ID. When a deletable blob is deleted, a BlobDeleted event is emitted: /// Signals that a blob has been deleted.
public struct BlobDeleted has copy, drop { epoch: u32, blob_id: u256, end_epoch: u32, // The object ID of the related `Blob` object. object_id: ID, // If the blob object was previously certified. was_certified: bool,
} The InvalidBlobID event is emitted when storage nodes detect an incorrectly encoded blob. Anyone attempting a read on such a blob is guaranteed to also detect it as invalid. /// Signals that a BlobID is invalid.
public struct InvalidBlobID has copy, drop { epoch: u32, // The epoch in which the blob ID is first registered as invalid blob_id: u256,
} System level events such as EpochChangeStart and EpochChangeDone indicate transitions between epochs. And associated events such as ShardsReceived, EpochParametersSelected, and ShardRecoveryStart indicate storage node level events related to epoch transitions, shard migrations and epoch parameters.

