The Walrus system object contains metadata about the available and used storage, as well as the price of storage per KiB of storage in FROST. The committee structure within the system object can be used to read the current epoch number, as well as information about the committee. public struct SystemStateInnerV1 has key, store { id: UID, /// The current committee, with the current epoch. committee: BlsCommittee, // Some accounting total_capacity_size: u64, used_capacity_size: u64, /// The price per unit size of storage. storage_price_per_unit_size: u64, /// The write price per unit size. write_price_per_unit_size: u64, /// Accounting ring buffer for future epochs. future_accounting: FutureAccountingRingBuffer, /// Event blob certification state event_blob_certification_state: EventBlobCertificationState,
} /// This represents a BLS signing committee for a given epoch.
public struct BlsCommittee has store, copy, drop { /// A vector of committee members members: vector<BlsCommitteeMember>, /// The total number of shards held by the committee n_shards: u16, /// The epoch in which the committee is active. epoch: u32,
} public struct BlsCommitteeMember has store, copy, drop { public_key: Element<G1>, weight: u16, node_id: ID,
}
